function sessionTimer(response) {

    // Set the date we're counting down to
    var countDownDate = new Date(response.paymentDetails.dueDate).getTime();

    // Update the count down every 1 second
    var x = setInterval(function () {

        // Get todays date and time
        var now = new Date().getTime();

        // Find the distance between now an the count down date
        var distance = countDownDate - now;

        // Time calculations for days, hours, minutes and seconds
        var days = Math.floor(distance / (1000 * 60 * 60 * 24));
        var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
        var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
        var seconds = Math.floor((distance % (1000 * 60)) / 1000);

        // Output the result in an element with id="demo"
        if (Object(__WEBPACK_IMPORTED_MODULE_0__create_modal_canvas__["b" /* getShadowRoot */])().querySelector(".timer-text")) {

            Object(__WEBPACK_IMPORTED_MODULE_0__create_modal_canvas__["b" /* getShadowRoot */])().querySelector(".timer-text").innerHTML = days + "d " + hours + "h "
                + minutes + "m " + seconds + "s ";

        }


        // If the count down is over, write some text 
        if (distance < 0) {
            clearInterval(x);
            const request = {
                overallStatus: 180,
                transactionID: response.paymentDetails.transactionID,
                MSISDN: response.paymentDetails.payload.MSISDN,
                description: 'No payment received',
                amount: 0,
                success: false,
                code: 0,
                accountNumber: response.paymentDetails.accountNumber,
                email: response.paymentDetails.customerEmail
            };

            //redirect to  merchants error page
            //Your payment session has timed out
            Object(__WEBPACK_IMPORTED_MODULE_7__displaySuccessPage__["a" /* default */])("", "", "", "", "", "", "httpError",
                {
                    httpCode: 400,
                    error: 'Your payment session has timed out',
                    url: '',
                    params: request,
                    requestType: "redirectToMerchantPage",
                    getCheckoutPaymentOptionsResponse: response
                });
        }
    }, 1000);
}


